import "./about.css";

export default function about() {
  return (
    <div className="about">
      <input type="text" className="contentImage"></input>
      <input type="text" className="contentName"></input>
      <input type="text" className="contentInform"></input>
      <img
        className="aboutImg"
        src="https://gearbox.imgix.net/https%3A%2F%2Fix-www.imgix.net%2Fsolutions%2Fbeach.jpg?w=1782&h=982&fit=crop&ixlib=js-2.0.0&s=696f7285735b866832b0d79abb471548"
        alt=""
      ></img>
    </div>
  );
}
